package testdata

import (
	"github.com/icon-project/btp/chain"
	"github.com/icon-project/btp/chain/near/types"
)

type SendTransactionWaitTest struct {
	description string
	testData    []TestData
}

func (t SendTransactionWaitTest) Description() string {
	return t.description
}

func (t SendTransactionWaitTest) TestDatas() []TestData {
	return t.testData
}

func init() {
	var testData = []TestData{
		{
			Description: "SendTransactionWait Success",
			Input: func() chain.TransactionParam {

				return chain.TransactionParam(&types.TransactionParam{
					Base64encodedData: "",
				})
			}(),

			Expected: struct {
				Success interface{}
				Fail    interface{}
			}{
				Success: "6zgh2u9DqHHiXzdy9ouTP7oGky2T4nugqzqt9wJZwNFm",
			},
		},
	}

	RegisterTest("SendTransactionWait", SendTransactionTest{
		description: "Test SendTransactionWait",
		testData:    testData,
	})
}
